import React from 'react';
import { Link } from 'react-router-dom';

const PropertyCard = ({ property }) => {
  // Debug the property object
  console.log('PropertyCard received property:', property);

  if (!property) {
    console.error('PropertyCard received null or undefined property');
    return <div className="bg-red-100 p-4 rounded">Error: Invalid property data</div>;
  }

  // Handle different property data formats
  const title = property.name || property.title || 'Unnamed Property';
  const price = property.price || property.pricePerNight || 0;
  const location = property.location || 
    (property.address ? `${property.address.city}, ${property.address.country}` : 'Location not specified');
  const imageUrl = property.image || 
    (property.images && property.images.length > 0 ? 
      (typeof property.images[0] === 'object' ? property.images[0].url : property.images[0]) 
      : 'https://via.placeholder.com/300x200');
  const id = property._id;

  return (
    <div className="bg-white rounded-lg shadow-md overflow-hidden hover:shadow-xl transition-shadow border border-gray-200">
      <Link to={`/properties/${id}`} className="block">
        <img 
          src={imageUrl} 
          alt={title} 
          className="w-full h-48 object-cover" 
          onError={(e) => {e.target.src = 'https://via.placeholder.com/300x200'; e.target.alt = 'Image not available';}}
        />
        <div className="p-4">
          <h3 className="text-lg font-semibold mb-2 truncate">{title}</h3>
          <p className="text-gray-600 mb-1">Price: ${price}/night</p>
          <p className="text-gray-500 text-sm">{location}</p>
        </div>
      </Link>
    </div>
  );
};

export default PropertyCard;
